import * as React from 'react';
import { useState, useEffect } from 'react';

const Index: React.FC = () => {
  const [count, setCount] = useState<number>(0);

  useEffect(() => {
    // pageviewscountを初期化する
    const pageView = 1;

    // stateを更新
    setCount(pageView);
  }, []);

  return (
    <>
      <div>HOME</div>
      <div>Page View Count is:</div>
      {count}
    </>
  );
};

export default Index;
